\"A.450MHz到6000MHz\",\"B.450MHz到3000MHz \",\"C.24250MHz到52600MHz \",\"D.3000MHz到6000MHz \"],\"answer\":\"A\",\"analysis\":null,\"\":null},{\"subject\":\"14.大规模天线与普通天线的区别为（）\",\"option\":[\"A.空间复用\",\"B.分集增益\",\"C.垂直方向波束赋形\",\"D.波束赋形\"],\"answer\":\"C\",\"analysis\":null,\"\":null},{\"subject\":\"15.5GNR接入网构架中，CU与DU划分方案中，以下选项中（）要求的F1传输带宽最高？\",\"option\":[\"A.option3\",\"B.option4\",\"C.option2\",\"D.option8\"],\"answer\":\"D\",\"analysis\":null,\"\":null},{\"subject\":\"16.对于5GNR，当u=1是，SCS等于（）\",\"option\":[\"A.30KHz。\",\"B.60kHz\",\"C.15kHz\",\"D.120kHz\"],\"answer\":null,\"analysis\":null,\"\":null},{\"subject\":\"17.高频段是指（）\",\"option\":[\"A.3-6GHz \",\"B.大于30G的频段\",\"C.大于6GHz\",\"D.小于3GHz\"],\"answer\":\"C\",\"analysis\":null,\"\":null},{\"subject\":\"18.预计到（）年，5G将开始在全球范围正式商用\",\"option\":[\"A.2050\",\"B.2018\",\"C.2020\",\"D.2030\"],\"answer\":\"C\",\"analysis\":null,\"\":null},{\"subject\":\"19.UDN组网方式主要是应对哪一个场景？\",\"option\":[\"A.热点高流量\",\"B.低时延高可靠性\",\"C.广覆盖\",\"D.大连接\"],\"answer\":\"A\",\"analysis\":null,\"\":null},{\"subject\":\"以下哪个不是5G核心网的网元\",\"option\":[\"A.上行数据信息 \",\"B.控制信息  \",\"C.参考信号  \",\"D.解调信号\"],\"answer\":\"A\",\"analysis\":null,\"\":null},{\"subject\":\"5GNR构架中，AMF与gNB之间的接口是\",\"option\":[\"A.N2\",\"B.Xn\",\"C.Gn\",\"D.F1\"],\"answer\":\"A\",\"analysis\":null,\"\":null},{\"subject\":\".向着三维化和大规模化的方向发展是在3GPP协议版本（）中提出的\",\"option\":[\"A.R12\",\"B.R13\",\"C.R11\",\"D.R10\"],\"answer\":\"A\",\"analysis\":null,\"\":null},{\"subject\":\"3GPP的第一个5G规范版本是\",\"option\":[\"A.R16\",\"B.R14\",\"C.R17\",\"D.R15\"],\"answer\":\"D\",\"analysis\":null,\"\":null},{\"subject\":\"5GNR构架中数据传输的方式不包括\",\"option\":[\"A.中传\",\"B.回传\",\"C.后传\",\"D.前传\"],\"answer\":\"C\",\"analysis\":\"后传不包括\",\"\":null},{\"subject\":\"在5GNR中，一个RB包含的子载波数量是\",\"option\":[\"A.24个\",\"B.12个\",\"C.6个\",\"D.18个\"],\"answer\":null,\"analysis\":null,\"\":null},{\"subject\":\"对于eMBB场景三种NR典型帧结构，以下描述正确的是\",\"option\":[\"A.上行容量：2.5ms单>2ms单>2.5ms双\",\"B.上行容量：2.5ms双>2ms单>2.5ms单\",\"C.下行容量：2.5ms单>2ms单>2.5ms双\",\"D.下行容量：2.5ms双>2ms单>2.5ms单\"],\"answer\":\"BC\",\"analysis\":null,\"\":null},{\"subject\":\"ITU对IMT2020提出的5G性能目标中，主要包括哪些\",\"option\":[\"A.空口时延1ms  \",\"B.上行方向10Gbps的峰值数据速率\",\"C.下行方向20Gbps的峰值数据速率\",\"D.每平方公里100万终端连接\"],\"answer\":\"ACD\",\"analysis\":null,\"\":null},{\"subject\":\"5G系统中哪些是无线接入网的接口\",\"option\":[\"A.Gn\",\"B.S6a\",\"C.F1\",\"D.Xn\"],\"answer\":\"CD\",\"analysis\":null,\"\":null},{\"subject\":\"对于R15版本的5GNR，以下说法正确的是\",\"option\":[\"A.当μ=1是，SCS=30kHz，可配置普通CP，此时一个无线帧中包含280个符号；\",\"B.当μ=1是，SCS=30kHz，可配置扩展CP，此时一个无线帧中包含240个符号；\",\"C.当μ=2是，SCS=60kHz，可配置扩展CP，此时一个无线帧中包含480个符号；\",\"D.当μ=2是，SCS=60kHz，可配置普道CP，此时一个无线帧中包含560个符号；\"],\"answer\":null,\"analysis\":null,\"\":null},{\"subject\":\"5G系统中C-RAN中的C代表哪些含义\",\"option\":[\"A.Clean\",\"B.Cloud\",\"C.Centralization\",\"D.Collaborative\"],\"answer\":\"ABCD\",\"analysis\":\"C-RAN是根据现网条件和技术进步的趋势，提出的新型无线接入网构架。C-RAN是基于集中化处理(Centralized Processing)，协作式无线电(Collaborative Radio)和实时云计算构架(Real-time Cloud Infrastructure)的绿色无线接入网构架(Clean system)。其本质是通过实现减少基站机房数量，减少能耗，采用协作化、虚拟化技术，实现资源共享和动态调度，提高频谱效率，以达到低成本，高带宽和灵活度的运营。C-RAN的总目标是为解决移动互联网快速发展给运营商所带来的多方面挑战（能耗，建设和运维成本，频谱资源），追求未来可持续的业务和利润增长。\",\"\":null},{\"subject\":\"以下属于5G网络演进趋势的是\",\"option\":[\"A.NFV：网络功能软件化\",\"B.用户面下沉，降低时延\",\"C.用网络切片实现不同场景，不同“专网”，满足物联定制化\",\"D.利用SDN实现网络自动化调整\"],\"answer\":\"ABCD\",\"analysis\":null,\"\":null},{\"subject\":\"5G需求驱动力\",\"option\":[\"A.物联网\",\"B.自动驾驶\",\"C.VR\\/AR\",\"D.大视频\"],\"answer\":\"ABCD\",\"analysis\":null,\"\":null},{\"subject\":\"5GNR中，下行参考信号包括\",\"option\":[\"A.PT-RS \",\"B.CRS \",\"C.DMRS \",\"D.CSI-RS\"],\"answer\":\"ACD\",\"analysis\":null,\"\":null},{\"subject\":\"Self-contained slot有两种结构，分别是\",\"option\":[\"A.UL-dominant slot \",\"B.UL-only slot \",\"C.DL-only slot\",\"D.DL-dominant slot\"],\"answer\":\"AD\",\"analysis\":null,\"\":null},{\"subject\":\"大规模天线可以\",\"option\":[\"A.降低小区干扰\",\"B.提升网络容量\",\"C.提高系统吞吐量\",\"D.提升频谱效率\"],\"answer\":\"ABCD\",\"analysis\":null,\"\":null},{\"subject\":\"5G系统中C-RAN高速移动场景使用的频率是\",\"option\":[\"A.30GHZ频段\",\"B.70GHZ频段\",\"C.4GHZ频段\",\"D.100GHZ频段\"],\"answer\":\"C\",\"analysis\":null,\"\":null},{\"subject\":\"当前，5G上行采用的多址技术是\",\"option\":[\"A.SC-FDMA\",\"B.OFDMA \",\"C.CP-OFDMA \",\"D.FDMA\"],\"answer\":\"B\",\"analysis\":\"5G多址技术，现在有三个备选方案，华为(SCMA)，中兴(MUSA,多用户共享接入(Multi-User Shared Access))，大唐(非正交多址接入（PDMA）)各有一个。\\n\\n目前已经采用的5G上行是OFDMA，下行是SCMA。未来全新的第五代移动通信网络空口技术将包括一种新的波形技术F-OFDM(，基于滤波的正交频分复用)、一种新的多址接入技术SCMA(稀疏码分多址接入)、一种新的信道编码技术polar coding(极性编码)、全双工移动通信技术、大规模MIMO\\/大规模天线阵列技术。\\n\\n国内提出的三个5G新的空口方案，华为的SCMA（基于多维调制和稀疏码扩频的稀疏码分多址技术），信道水平可以提升300%；大唐的PDMA（基于非正交特征图样的图样分割多址技术），降低了复杂度；中兴的MUSA（基于复数多元码及增强叠加编码的多用户共享接入技术），实现了免调度传输。\\n\",\"\":null},{\"subject\":\"高频段的特点是\",\"option\":[\"A.穿透弱B.损耗大\",\"C.天线阵尺寸大\",\"D.距离短\"],\"answer\":\"ABD\",\"analysis\":null,\"\":null},{\"subject\":\"当前中国移动5G可用的频率有哪些\",\"option\":[\"A.2515MHz-2675MHz\",\"B.3400MHz-3500MHz\",\"C.4800MHz-4900MHz\",\"D.3500MHz-3600MHz\"],\"answer\":\"AC\",\"analysis\":null,\"\":null},{\"subject\":\"5G系统中网元AMF的功能包括\",\"option\":[\"A.用户鉴权及密钥管理\",\"B.承载管理功能，包括专用承载建立过程\",\"C.NAS移动性管理\",\"D.NAS信令及信令的加密和完整性保护\"],\"answer\":\"ABCD\",\"analysis\":null,\"\":null},{\"subject\":\"高频通信的优势是\",\"option\":[\"A.可用频段宽\",\"B.穿透能力强\",\"C.方向性好，受干扰影响小\",\"D.波束集中，提高能量\"],\"answer\":\"ACD\",\"analysis\":\" \",\"\":null},{\"subject\":\"5GNR系统中gNB包括哪些模块\",\"option\":[\"A.CU\",\"B.DU\",\"C.CCE\",\"D.AAU\"],\"answer\":\"ABD\",\"analysis\":null,\"\":null},{\"subject\":\" 5G基本时间单位（Tc）与LTE基本时间单位（Ts）是一样的。\",\"option\":[\"A对 \",\"B错\"],\"answer\":\"B\",\"analysis\":\" \",\"\":null},{\"subject\":\"5G网络在中国与2019年11月1日正式商用\",\"option\":[\"A对 \",\"B错\"],\"answer\":\"B\",\"analysis\":null,\"\":null},{\"subject\":\"5G组网部署，中国移动白皮书中明确规定子载波间隔为30KHz子载波是必选\",\"option\":[\"A对 \",\"B错\"],\"answer\":\"B\",\"analysis\":null,\"\":null},{\"subject\":\"C-RAN中，为了保证高效的时延控制，需要高速传输网络或光纤直连RRU，数据统一传输到中心机房进行处理，减少中间的流程，同时DU和CU则可以部署在同一位置，网络实体则合而为一\",\"option\":[\"A对 \",\"B错\"],\"answer\":\"A\",\"analysis\":null,\"\":null},{\"subject\":\"大规模天线可以是有源天线也可以是无