INSERT INTO `api_synthesize_leader_sign` (`id`, `uid`, `job`, `advantage`, `create_time`, `update_time`) VALUES
(1, 669, '学习委员', '1、做好师生之间沟通的桥梁，更好的服务于同学和老师。\n2、协助老师完成教学工作。\n3、帮助同学，大家一起进步。', 1621473343, 1621473343),
(2, 660, '文艺委员', '协助各班委的工作', 1621474099, 1621474099),
(3, 575, '生活委员', '管理宿舍和班级卫生 负责每天早、中和宿舍长收发宿舍照片 整理发给老师 管理班费 学费缴费 参保等 帮助同学和老师', 1621474144, 1621474144),
(4, 395, '学习委员', '1.帮助各任课老师顺利开展教学工作。\n2.及时反映同学们学习上的意见和建议。\n3.积极帮助同学们解决遇到的问题。\n', 1621478810, 1621478810),
(5, 555, '学习委员', '协助任课老师完成教学任务，组织大家填写表格，帮助同学与老师沟通。', 1621481244, 1621481244),
(6, 632, '纪律委员', '担任纪律委员以来，我积极做好本职工作，帮助同学解决问题，假期及时通知大家打卡。希望在以后能与大家一起更加努力。', 1621492167, 1621492167),
(7, 614, '宣传委员', '负责班级活动新闻的撰写，疫情期间志愿者的统计与总结，帮助班长团支书组织委员开展相关工作。', 1621495656, 1621495656),
(8, 5, '学习委员', '1.与任课老师和学生沟通确认教学进度。\n2、资料整理：跟进课程、收发作业\n3、了解学生学习问题，及时完成相关答疑工作。\n4、学期末整理笔记，和任课老师沟通，整理出课程重点并分发给学生降低挂科率', 1621556695, 1621556695),
(9, 573, '团支书', '负责班级的团务工作和班级日常事务，与班长组宣委员相互配合完成团支部评比和团日活动等各类活动，获得院级五四红旗团支部和精品团日活动，统计信息，帮助同学完成团培推优工作，协助辅导员老师。', 1621557368, 1621557368),
(10, 373, '班长', '协助辅导员老师处理班级事务，统计信息，综合测评与其他团干配合参加各种班级评比，获得多项荣誉。', 1621557497, 1621557497),
(11, 544, '心理委员', '需要填写心里问卷的时候，督促大家填写问卷\n同时大三下学期兼任学习委员，负责上课前帮老师打开多媒体，负责收发作业，教授课登记表', 1621559282, 1621559282),
(12, 628, '组织委员', '协助班长团支书宣传委员参加完成团内活动，做ppt，进行评比演讲等，协助计算综测，以及贫困生的统计。督促大家完成青年大学习，并按时向上提交截图。', 1621560627, 1621560627),
(13, 638, '纪律委员', '疫情期间以及在校期间，每天监督同学晨午检打卡，向辅导员汇报', 1621564262, 1621564262),
(14, 685, '生活委员', '管理班级宿舍情况，收集宿舍安全情况照片，核对收集班级医保缴费名单，管理班费', 1621574560, 1621574560),
(15, 93, '心理委员', '保障心理测评工作顺利完成', 1621602804, 1621602804),
(16, 87, '班长', '组织同学进行各种活动，协助导员管理班级', 1621832012, 1621832012),
(17, 557, '班长', '帮助老师管理班级，协调班级里的事物，及时向老师反映学生的情况', 1621832394, 1621832394),
(18, 618, '生活委员', '在大三的学年里，大三上负责帮助同学填写贫困生表格，每天发送宿舍图片给老师，督促同学离宿及时断电，配合其他各个班委的工作。', 1621832845, 1621832845),
(19, 583, '纪律委员', '纪律委员\n管理钉钉打卡，管理纪律出勤', 1621841651, 1621841651),
(20, 619, '班长', '这个学年，干了不少，也确实没闲着，大家凭心而论给我打分吧୧( ⁼̴̶̤̀ω⁼̴̶̤́ )૭', 1621850502, 1621850502),
(21, 598, '团支书', '负责各种大的小的团的工作的开展、及通知dddd', 1621850568, 1621850568),
(22, 649, '学习委员', '主要负责课程记录，帮助老师传达课上问题与作业，与老师积极沟通，解决课堂问题，及时报告同学们学习情况', 1621851488, 1621851488),
(23, 453, '生活委员', '督促钉钉打卡\n提醒打扫为卫生\n各种生活问题', 1621857445, 1621857445),
(24, 462, '团支书', '帮助老师管理班级事务，整理团内职务，做好支部推优工作，带领班级获得多项荣誉', 1621939378, 1621939378),
(25, 251, '团支书', '完成团组织活动通知的上传下达，协助辅导员管理班级', 1622008969, 1622008969),
(26, 562, '生活委员', '完成钉钉打卡任务\n安排日常班级卫生', 1622009029, 1622009029),
(27, 560, '学习委员', '今年也谢谢大家的支持和配合呀！', 1622009072, 1622009072),
(28, 531, '组织委员', '负责班级的组织工作，协助班委管理，帮助团支书督促同学们学习青年大学习', 1622009224, 1622009224),
(29, 630, '宣传委员', '组织班级活动，撰写新闻稿，将计科三班更好的介绍给同学们。', 1622010286, 1622010286),
(30, 706, '组织委员', '组织青年大学习\n配合团支书的工作', 1622011025, 1622011025),
(31, 700, '宣传委员', '1、负责完成班级所有班会、以及其他活动的照片拍摄和记录与宣传。\n2、负责完成班级工作、部分活动的新闻稿。\n3、协助其他班委完成班级的一些工作。', 1622011686, 1622011686),
(32, 681, '宣传委员', '1、负责完成班级所有班会、以及其他活动的照片拍摄和记录与宣传。\n2、负责完成班级工作、部分活动的新闻稿。\n3、协助其他班委完成班级的一些工作。', 1622011688, 1622011688),
(33, 551, '宣传委员', '协助各班委开展组织班级活动，拍照整理视频，撰写新闻稿', 1622043508, 1622043508),
(34, 613, '心理委员', '帮助学校组织学生填写调查问卷，关心同学们的心理健康', 1622043704, 1622043704);
