INSERT INTO `api_synthesize_poor_sign` (`id`, `uid`, `political_outlook`, `id_card_type`, `id_card_number`, `poor_type_one`, `poor_type_two`, `poor_type_three`, `poor_type_four`, `poor_type_five`, `poor_type_six`, `poor_type_seven`, `poor_type_eight`, `confirm_reason`, `confirm_reason_explain`, `address`, `home_phone`, `contact_phone`, `remark`, `supporting_document`, `create_time`, `update_time`) VALUES
(1, 1, '共青团员', '居民身份证', '130503200001100639', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭欠债\",\"其他\"]', '家庭收入较低 欠债', '河北省邢台市信都区拥军街', '13315926692', '13315926692', '', '/uploads/synthesize/poor/申正2018510500/2021/05/14/78479bacf5d00b64279090a088541c7c0fb454c4/653.jpg', 1620873191, 1620873191),
(2, 2, '共青团员', '居民身份证', '131025200001273048', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭成员失业\",\"家庭欠债\"]', '因家庭变故，负有债务，爷爷为省钱，以死相逼不住ICU，最终病死家中，4月15日，嫂嫂更是因家中贫穷与哥哥办理离婚', '河北省廊坊市大城县', '18332173611', '18332173611', '', '/uploads/synthesize/poor/李晨颍2018510672/2021/05/14/d442bd076a6f8b74e39867eca3881f4f1c1ee6ce/QQ图片20210514165641.jpg', 1620873364, 1620873364),
(3, 558, '共青团员', '居民身份证', '张倩', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受家庭遭受自然灾害\",\"年迈而劳动能力弱情况\",\"家庭欠债\"]', '家庭收入主要靠仅有的5亩田地，父母处于务农，经常生病，吃药，还有照顾年迈的爷爷奶奶和在上中学的弟弟，前不久由于奶奶脑梗塞，生病住院，还欠了3w余外债。', '安徽省宿州市灵璧县朱集乡张家庄', '15055364087', '15055364087', '无', '/uploads/synthesize/poor/张倩2018512962/2021/05/13/5e5c0540fd47ac9559fa33293513aa3ecb6d25f0/B.png', 1620873976, 1620873976),
(4, 122, '共青团员', '居民身份证', '130481200001231827', 0, 1, 0, 0, 0, 0, 1, 0, '[\"家庭成员因残疾\",\"家庭欠债\",\"低保\"]', '家庭成员残疾，疾病。', '河北省武安市淑村镇淑村', '15027971365', '15028029255', '', '/uploads/synthesize/poor/任玎2018510689/2021/05/13/c0eb8013d0115522bad1d012ec1b7c55962d2190/IMG_20210513_105554.jpg', 1620874569, 1620874569),
(5, 599, '共青团员', '居民身份证', '130602200009220925', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭欠债\",\"其他\"]', '家庭收入较低 欠债', '河北省保定市新市区乐凯北大街821号', '13400334870', '13400334870', '', '/uploads/synthesize/poor/单烁2018510520/2021/05/13/dcdf07cad120d423db7ae81f02883d0b430c949f/AEE5625A-AE9E-46B1-88C7-9C6E7F4F65AD.png', 1620874634, 1620874634),
(6, 576, '共青团员', '居民身份证', '130733200012131528', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\",\"家庭欠债\"]', '母亲生病花了一大笔费用，家里有年迈的爷爷奶奶要供养，妹妹也到了上学的年纪，家里的经济完全由爸爸一人独立承担，家里还有大笔的外债没有还清。', '河北省张家口市崇礼县石嘴子村', '15297319379', '15630161061', '', '/uploads/synthesize/poor/霍星潼2018510666/2021/05/13/a0b3d319e05344c64d89540eb4011cffc422e4e7/IMG_20210513_105630.jpg', 1620874750, 1620874750),
(7, 552, '共青团员', '居民身份证', '130521200006093522', 0, 1, 0, 0, 0, 0, 1, 0, '[\"家庭成员因残疾\",\"年迈而劳动能力弱情况\",\"家庭成员失业\",\"低保\"]', '17年父亲查出脑梗塞，由于家庭经济原因未能住院，只能一直服药，又在去年查出患有抑郁后，症祸不单行左腿摔伤骨折，住院欠外债，母亲患有腰间盘突出，腿脚不便。', '河北省邢台市邢台县羊范镇大路村', '15297466192', '15031947195', '', '/uploads/synthesize/poor/吉红瑞2018510587/2021/05/13/4e5a5a7eecd8e42d9e6b9233c897c87ab7d88bab/23C0B805540D2F8074035F974809B4F6.jpg', 1620875404, 1620875404),
(8, 550, '共青团员', '居民身份证', '131128200002290020', 0, 0, 0, 0, 0, 0, 1, 0, '[\"家庭遭受突发意外事件\",\"家庭成员因残疾\",\"年迈而劳动能力弱情况\",\"家庭成员失业\"]', '父亲残疾，无劳动能力，母亲患高血压心脏病，需常年吃药维持身体，姐姐失业在家，照顾父亲', '河北省衡水市阜城县三里铺村', '13131880618', '15610890113', '', '/uploads/synthesize/poor/史程程2018510554/2021/05/13/6d3ec2f989ae2d6ed18cb05a0f8f0faea9d2b48d/IMG_20210513_103918.jpg', 1620875892, 1620875892),
(9, 407, '共青团员', '居民身份证', '130126200009141227', 1, 0, 0, 0, 0, 0, 0, 0, '[\"建档立卡家庭\"]', '建档立卡', '河北省石家庄市灵寿县岔头镇台头村', '13473874130', '15931183321', '', '/uploads/synthesize/poor/马子涵2018510726/2021/05/13/f5d377e3046c468ccce35fbec7f51e1f9de34f14/mmexport1620876043086.jpg', 1620876241, 1620876241),
(10, 578, '共青团员', '居民身份证', '130281200011151125', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\",\"家庭欠债\"]', '父母都是老实本分的农民，每天早出晚归，勤勤恳恳，由于疫情原因导致参加工作的机会很少，生活是雪上加霜。我还有一个正在读大学的弟弟也需要用钱，加上我们俩个上学高额学费，使我们家庭难以承受。父母为了使家庭的生活水平好点，常常在外面打小工，努力挣钱，自己省吃俭用。爷爷奶奶年龄大了，需要靠药物来维持，也欠了很多外债。', '河北省遵化市兴旺寨乡珠岭村', '18833325707', '19912322269', '', '/uploads/synthesize/poor/钟欣2018510746/2021/05/13/713d94df17c07d2005e1d3eeffcd0c21f3028494/贫困生申请.png', 1620877021, 1620877021),
(11, 555, '共青团员', '居民身份证', '131002200005093226', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭欠债\"]', '家里5口人，爸爸个体体力干水暖活等挣钱，妈妈身体不好只能干些轻快活，经常腰痛还需照顾常年卧床的奶奶，奶奶血压不正常，经常吃降压药，爷爷于大前年因患胃癌去世 ，医疗费透支，至今欠款近4万元。', '河北省廊坊市广阳区万向城', '13633269264', '18831648490', '', '/uploads/synthesize/poor/汪桓宇2018510646/2021/05/13/c7ea80db2f42fd1a9c45973338211f968041bca5/Screenshot_20210513_113645_com.huawei.notepad_edit_120016335252518.jpg', 1620877023, 1620877023),
(12, 553, '共青团员', '居民身份证', '130427200010166926', 0, 0, 0, 0, 0, 0, 0, 0, '[\"其他\"]', '爷爷患有阿尔兹海默症，奶奶患有糖尿病，姥姥患癌症，妈妈辞去工作照顾姥姥，爸爸在外务工，家庭经济来源只有爸爸', '河北省邯郸市磁县贾壁乡双合村', '18830885824', '17531011329', '', '/uploads/synthesize/poor/宋莹慧2018510533/2021/05/13/784dd6783756274743ec4a220a5a03e6114ee8bd/IMG_20210513_114015.jpg', 1620877697, 1620877697),
(13, 547, '共青团员', '居民身份证', '130532199902196021', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\"]', '母亲出车祸无法干体力活，哥哥因为白血病去世', '河北省邢台市平乡县后营村', '15131315385', '18332217006', '', '/uploads/synthesize/poor/常晓露2018510597/2021/05/13/420edd31f72269b409e7b82e3410dffc0639c606/IMG_20210513_121538.jpg', 1620879464, 1620879464),
(14, 544, '共青团员', '居民身份证', '130182200003186249', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\"]', '母亲被人用斧头在头上砍了10公分的伤口，有滑膜炎，需要做手术', '河北省石家庄市藁城区前西关镇梁家庄村', '13582038874', '13171575763', '', '/uploads/synthesize/poor/郝梦男2018510546/2021/05/13/2413e81485857f39342726c551e2fd62eec1fa4c/IMG20210513123153.jpg', 1620880743, 1620880743),
(15, 581, '共青团员', '居民身份证', '130728199903245522', 1, 1, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"建档立卡家庭\",\"低保\"]', '建档立卡、低保家庭，父母因年迈而劳动能力弱', '河北省张家口市怀安县太平庄乡太平庄村', '15127375986', '15832382364', '', '/uploads/synthesize/poor/王帅2018510637/2021/05/13/adf181938db1eca374bca9c54a5ebacf53b13738/mmexport1620875257882.jpg', 1620880855, 1620880855),
(16, 477, '共青团员', '居民身份证', '120225200007294075', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\",\"家庭成员失业\",\"家庭欠债\"]', '家中六口人，本人腓总神经受损，曾长期住院，至今未痊愈，未致残但仍无法正常进行体育运动，需要长期服药，父母无固定职业且都患有重病，爷爷靠捡垃圾微薄收入，奶奶心力衰竭三天前进了ICU，父母各处借钱勉强医药费够用，让家中本未还完的负债雪上加霜，哥哥早已辍学，没有学历跟父母在家务农。', '天津市蓟州区尤古庄镇果庄子村', '13116081271', '18522801139', '', '/uploads/synthesize/poor/杨星宇2018510492/2021/05/13/ce39c316872393c6be0ce0c530cc00a49336bf65/a8d5026b6f1f73f.jpg', 1620880924, 1620880924),
(17, 111, '共青团员', '居民身份证', '130181199910038248', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\",\"家庭成员失业\",\"家庭欠债\"]', '家里负债累累，生活困难，上学子女较多，只有爸爸工作，妈妈在家照顾爷爷奶奶，弟弟在外上学，爸爸给人打工，收入微薄，入不敷出', '河北省石家庄市辛集市田家庄乡豆腐庄村', '13703294209', '15103117549', '因家庭困难申请贫困生资格，望批准', '/uploads/synthesize/poor/张任愿2018510659/2021/05/13/74a9d46ed1ec38f0724df671ae006757defe96c4/mmexport1567559479280.jpg', 1620883146, 1620883146),
(18, 564, '共青团员', '居民身份证', '130684200009221367', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭成员失业\",\"其他\"]', '母亲有患精神分裂症，长期吃药控制，没有工作能力，奶奶七十多岁在家照顾妈妈，每次妈妈犯病时需要父亲在家看护，不能工作。家里只有父亲一个人在工地工作，劳动力缺失', '河北省保定市高碑店市方官镇塔楼村', '13483275129', '17733831744', '', '/uploads/synthesize/poor/方迎澳2018510731/2021/05/13/572f3386d90b7c74274ae3b2b1732f3855823b30/mmexport1620883575009.jpg', 1620883655, 1620883655),
(19, 563, '共青团员', '居民身份证', '130181199912204529', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\",\"家庭成员失业\",\"家庭欠债\"]', '父母下岗失业，我和弟弟上学，奶奶妈妈患有慢性病', '河北省石家庄市辛集市旧城镇孟章村', '18032890886', '18032890886', '', '/uploads/synthesize/poor/赵紫澳2018510635/2021/05/13/1113f32c3ab20b00ea25cd070a16de6f7aa37654/IMG_20210513_141053.jpg', 1620886278, 1620886278),
(20, 604, '共青团员', '居民身份证', '130705199906293015', 0, 1, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"家庭欠债\"]', '负债9万元，父亲心衰，治疗加医药费很难承担。父亲现在无劳动能力。', '河北张家口市宣化区皇城世纪园', '15297339493', '13731332256', '', '/uploads/synthesize/poor/郭立2018510440/2021/05/14/448b1d4e8eb704456a1d5ec1183b1c72165ba014/mmexport1620890096349.jpg', 1620890345, 1620890345),
(21, 605, '共青团员', '居民身份证', '130630199906220079', 0, 0, 0, 0, 0, 0, 1, 0, '[\"家庭遭受突发意外事件\",\"家庭成员因残疾\",\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\",\"家庭成员失业\",\"家庭欠债\"]', '家中7口人，4个孩子上学，父母均务农，父亲先天性疾病残疾，奶奶糖尿病长期注射胰岛素', '河北省保定市涞源县丰乐村', '13331215060', '17333444684', '', '/uploads/synthesize/poor/张旭2018510483/2021/05/13/bdb2a99a4e6a284d6ed3a825b5a60e79f27f6246/-6f91989ca878808f.jpg', 1620890448, 1620890448),
(22, 406, '共青团员', '居民身份证', '371421199905062214', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"家庭成员失业\",\"家庭欠债\"]', '由于疫情，父母开饭店倒闭负债十余万，爷爷奶奶重病急需用钱', '山东省德州市陵城区徽王庄', '18732635341', '17734595974', '', '/uploads/synthesize/poor/王磊2018510804/2021/05/13/8bfa967b3a7e4d78c0a2c1de96aa5be3fcb39b40/2021-05-13_15.25.04.jpg', 1620890762, 1620890762),
(23, 114, '共青团员', '居民身份证', '130230200006022329', 0, 0, 0, 0, 0, 0, 1, 1, '[\"家庭成员因残疾\",\"年迈而劳动能力弱情况\",\"家庭成员失业\",\"家庭欠债\"]', '父亲因癌症去世，母亲患有乳腺癌，曾手术治疗，具有二级残疾证，现在为药物治疗阶段，无法工作，爷爷无法下床，需要照顾，欠债27万元，家庭经济困难！', '河北省唐山市曹妃甸区八农场尚庄子村', '18531529682', '15630161050', '', '/uploads/synthesize/poor/孟妍2018510722/2021/05/13/e3259e6595f08bb685301aff18dfb45be97a6926/mmexport1620894599782.jpg', 1620894714, 1620894714),
(24, 412, '共青团员', '居民身份证', '130123200010032723', 0, 0, 0, 0, 0, 0, 1, 0, '[\"家庭遭受突发意外事件\",\"家庭成员因残疾\",\"家庭欠债\"]', '爸爸是残疾军人，妈妈因病长期服药，爷爷在查出癌症后去世，为治病借了很多钱', '河北省石家庄市正定县新城铺', '15081110479', '15131190682', '', '/uploads/synthesize/poor/魏叶茹2018510752/2021/05/13/532d4968a604d5ebfde886ada374f4226ddb6b6f/mmexport1620896431118.jpg', 1620897146, 1620897146),
(25, 546, '共青团员', '居民身份证', '130324200001010023', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"年迈而劳动能力弱情况\"]', '之前爷爷奶奶住院花费大量的医药费，爷爷奶奶去世后父亲又突发脑血栓，无法外出打工，需要天天吃药，母亲常年劳作身体不好。', '河北省秦皇岛市卢龙县卢龙镇三里庄村', '15512091819', '13292339310', '', '/uploads/synthesize/poor/董妍2018510599/2021/05/13/3c42c10b0461562744c86c896c17284bdd998ba2/mmexport1620902302913.jpg', 1620902554, 1620902554),
(26, 728, '共青团员', '居民身份证', '131181200010141721', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"家庭成员失业\"]', '家庭突发意外，父亲卧病在床，爷爷奶奶年迈常年依靠药物维持。', '河北省衡水市冀州区北漳淮乡北内漳村', '13932803876', '19832117780', '爷爷奶奶患病常年吃药，家庭突发意外，父亲车祸受伤住院，一直需要有人照顾。母亲没有工作一直以种地为生，这因为意外精神受到了很大的打击，现在一直在服用药物维持。弟弟正在上学，面临着不少的费用。', '/uploads/synthesize/poor/李春滢2018510656/2021/05/13/f3593488d3573c95936c075a6cae0a7b43966629/IMG_20210513_184622.jpg', 1620902828, 1620902828),
(27, 590, '共青团员', '居民身份证', '130923199912020519', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"年迈而劳动能力弱情况\",\"家庭欠债\"]', '父亲腿烫伤，手指受伤，干不了重活。家庭欠债20000元', '河北省沧州市东光县大单镇仉祥崔村57号', '15028730937', '15533740783', '', '/uploads/synthesize/poor/崔忠康2018510472/2021/05/13/1a84b8f9fd06c850f6d3749a3aed77ab2695ecbc/Screenshot_2021_0513_185249.png', 1620903696, 1620903696),
