(30, 671, '共青团员', '居民身份证', '130324199908140028', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"年迈而劳动能力弱情况\",\"家庭欠债\"]', '父亲患有动脉粥样硬化和脑梗，不能从事过多的体力劳动，母亲患有糖尿病和气胸，平时需要药物来维持，家里经济来源仅靠家里的三亩地和父亲身体状况好点的时候去打点轻巧的零工，外加上学欠债', '秦皇岛市卢龙县卢龙镇王永庄村', '19921198521', '19921198521', '', '/uploads/synthesize/poor/姜心悦2018510621/2021/05/13/caa178f564a1e1a142f8b05021d23a70dd02e769/AF6A4A44-6B46-4BF4-9F96-6B92C0E275E0.png', 1620906770, 1620906770),
