(33, 554, '共青团员', '居民身份证', '130625200007021628', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\",\"家庭欠债\"]', '家中有六口人，有八十一岁的奶奶，弟弟妹妹都还在上学，奶奶和爸爸有高血压，常年吃药，家中只靠父亲一人挣钱，母亲只能照顾奶奶，前段时间爸爸的脚还做了手术，全家生活已拮据', '河北省保定市徐水区东史端乡梁庄村富强街127号', '15933226031', '15188939707', '', '/uploads/synthesize/poor/闫格2018510542/2021/05/13/37f57d0968fbf5b3c5e1a6b0609cb905a4fa5f56/mmexport1620895777158.jpg', 1620914420, 1620914420),
