(40, 373, '共青团员', '居民身份证', '130722199906023812', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"家庭成员因残疾\",\"年迈而劳动能力弱情况\",\"家庭欠债\"]', '父亲干活小拇指被切断，导致残疾，母亲拇指筋被机器绞断', '河北省张家口市张北县海流图乡', '18731327473', '18332173272', '', '/uploads/synthesize/poor/石辉2018510482/2021/05/13/745e47ae98324ffea5f8b7498219e843a42f41d4/IMG_20200401_093340.jpg', 1620918169, 1620918169),
(41, 446, '群众', '居民身份证', '130528200009132413', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭成员失业\",\"其他\"]', '父亲失业，多病，手术后没能痊愈，药不断。家中靠四亩田地和母亲在服装厂的收入维持。奶奶有痴呆，高血压等病症，大大小小的手术不断，药不停，开销很大。', '河北省邢台市宁晋县北河庄镇东孟村', '13831941915', '15612990017', '', '/uploads/synthesize/poor/刘晨彪2018510428/2021/05/13/7d113fafcfb55feff858ffa597b02e00c84f6cc5/Screenshot_20210513_225420_cn.wps.moffice_eng.jpg', 1620918822, 1620918822),
(42, 572, '共青团员', '居民身份证', '130582199901261622', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭成员失业\",\"其他\"]', '家里仅靠母亲一人的收入，爸爸因疲劳患有腰间盘突出无法工作，奶奶患有心脏病，每个月都需要买药，我和哥哥都还在需要花钱的阶段。', '河北省邢台市桥西区张宽办事处东马庄', '15227619270', '15227619270', '', '/uploads/synthesize/poor/杨毅2018510720/2021/05/14/3db5196dc328f4e2106d4ae6242e85f30571d357/-216f13bcfe0f9248.jpg', 1620950878, 1620950878),
(43, 571, '共青团员', '居民身份证', '130433199904102720', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"年迈而劳动能力弱情况\",\"家庭欠债\"]', '  父亲重病在家，需要家人伺候。母亲如今年纪大，没有劳动能力，家中经济来源主要靠粮食收成和在工作姐姐的家用补贴，每年学费其中8000元来自申请的国开行助学贷款，家中经济实在贫困。特此申请补助。', '河北省邯郸市馆陶县南徐村乡北郭庄村', '15511029087', '15511029087', '', '/uploads/synthesize/poor/陈敏2018510651/2021/05/14/69b6ed0a693f2c9ea3049e5bde573d50e350d35f/-4fc73f6def7f072e.jpg', 1620952658, 1620952658),
(44, 568, '共青团员', '居民身份证', '130125200007083047', 1, 0, 0, 0, 0, 0, 0, 1, '[\"家庭欠债\",\"其他\",\"建档立卡家庭\"]', '家里欠了很多外债 姐姐是残疾人 父亲因高血压不能干重活', '河北省石家庄市行唐县上碑镇东北街村', '15127085702', '15127085702', '', '/uploads/synthesize/poor/戴金宏2018510552/2021/05/14/0b7b491eead76ac61e473326dfd02c0e36b936db/2.jpg', 1620953287, 1620953287),
(45, 573, '中共党员', '居民身份证', '130107199905281821', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"年迈而劳动能力弱情况\",\"其他\"]', '父母年龄大，劳动力弱，都患病，收入低', '河北省石家庄市井陉矿区冯家沟', '13930419887', '15631126576', '父母58岁高龄，年迈劳动力弱，母亲患有子宫肌瘤，做过手术，身体虚弱，近年又患上了心脏病，常年吃药，不能外出工作，只有父亲一人打零工养家，父亲近两年耳朵听力一直不好，今年检查需要佩戴助听器，又增加了一大笔费用，家庭经济困难。', '/uploads/synthesize/poor/冯胜怡2018510744/2021/05/14/0f0f82101bff3bbacd0ca6734955f3165a638903/51205b7ff0d37b2.jpg', 1620956580, 1620956580),
