(47, 601, '共青团员', '居民身份证', '130823199806264522', 1, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"家庭成员失业\",\"建档立卡家庭\"]', '父亲患有急性心肌梗塞，冠心病，房颤，不能参加重体力劳动，需要长期吃药静养，母亲患有乳腺增生，也需要经常吃药', '河北省承德市平泉市桲椤树镇八十亩地新村', '15512364810', '18032485782', '', '/uploads/synthesize/poor/蔡静美2018510600/2021/05/14/dee61dcbf30c7787162438dcf6ff8be4850df48e/mmexport1620958964172.jpg', 1620959221, 1620959221),
