(52, 588, '共青团员', '居民身份证', '130283200010182969', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\",\"家庭成员失业\"]', '父母都是农村人，都已年过半百，家里的经济来源还全靠父亲一人，母亲心脏和脑血管不太好，去年年底身体突然恶化住了好久的医院，从事不了太重的体力劳动，父亲的肠胃从前年开始每天疼痛，每到吃饭的时候父亲母亲都是以吃药结束。我下面还有一个即将上大学的弟弟，固定支出变得更多了。每年的暑假寒假我都会出去打工，稍稍减轻一点生活压力，打工之余，回家家帮父亲干活，装货，卸货，一起出去送货', '河北省迁安市建昌营镇郭庄村', '13785097097', '15176705014', '', '/uploads/synthesize/poor/贺莉媛2018510840/2021/05/14/1a244a1b80e6856a09b255846814a35f81b3fe20/IMG_20210514_120356_edit_694515187604961.jpg', 1620965244, 1620965244),
(53, 597, '共青团员', '居民身份证', '130523199605150610', 0, 0, 0, 0, 0, 0, 1, 0, '[\"家庭成员因残疾\",\"年迈而劳动能力弱情况\",\"家庭欠债\"]', '父亲精神二级残疾，奶奶瘫痪在床，常年吃药，家里欠债，仅靠母亲种几亩地维持生活', '河北省邯郸市馆陶县房寨镇孩寨村424号', '15324010005', '15303306271', '', '/uploads/synthesize/poor/刘贵杰2018510459/2021/05/14/deae4c95614abb5ce2ca25db39818f00031008e7/mmexport1620965441416.jpg', 1620965523, 1620965523),
(54, 138, '共青团员', '居民身份证', '131127199912275506', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\",\"家庭成员失业\",\"家庭欠债\"]', '父母有心脏病长期吃药，还有年迈的爷爷奶奶需要照顾', '河北省衡水市景县青兰乡西青兰村', '13131806563', '15175855258', '', '/uploads/synthesize/poor/崔月英2018510820/2021/05/14/4d3d485b71fd2a03ade7460e1578431c3b698e6c/IMG_20210514_121845.jpg', 1620966154, 1620966154),
(55, 603, '共青团员', '居民身份证', '130530200010120040', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭适龄就学子女较多\",\"家庭成员失业\",\"家庭欠债\"]', '靠父亲一人挣钱养家，而父亲被诊断为高血压三级很高危、高血压脑病等不能干重活，需要每天吃贵药；母亲身体不好也没有工作；妹妹即将上高中，需要交学费；姥爷患了癌症需要出钱治疗。', '河北省邢台市新河县飞马新村', '15350843672', '18233970915', '', '/uploads/synthesize/poor/徐寒2018510829/2021/05/14/408c140f5cab00f57a2dc4feaf260be00b8ab31b/IMG_20210514_121753.jpg', 1620966494, 1620966494),
(56, 598, '中共党员', '居民身份证', '131123200004183622', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\"]', '家庭靠父母兄弟维持生计。有96岁老太太需要赡养，爷爷奶奶都70多岁没有劳动能力，且老太太和爷爷奶奶都患多种慢性病，皆需常年吃药。还有弟弟妹妹在上中学，需很多学杂费和生活费。', '河北省衡水市武强县周窝镇大安院村', '13643188007', '15633650878', '', '/uploads/synthesize/poor/高欣2018510819/2021/05/14/cb7eeffc8b01da436dc8cf44afa73c2422fdd747/IMG_20210514_122556.jpg', 1620966692, 1620966692),
(57, 67, '共青团员', '居民身份证', '130183200012130585', 0, 0, 0, 0, 0, 0, 0, 1, '[\"其他\"]', '单亲家庭，随母亲租房居住，靠母亲打工生活经济压力重，没有其他经济来源。', '河北省石家庄市晋州市纪庄村', '13833130568', '18832165296', '', '/uploads/synthesize/poor/张紫硕2018510813/2021/05/14/e83b42c184dd3cee4f348192456a234a3469c889/IMG_20210514_123050.jpg', 1620966836, 1620966836),
(58, 586, '群众', '居民身份证', '130223199910105545', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\",\"家庭欠债\",\"其他\"]', '父母劳动能力弱，供自己和弟弟上学负担重，', '河北省唐山市滦州市东安各庄镇西商家林村', '15032954119', '15027664526', '', '/uploads/synthesize/poor/李小玉2018510833/2021/05/14/68037d40871b59d7ab477b79a6b3fa348933d06f/IMG20210514124955.jpg', 1620967896, 1620967896),
(59, 595, '共青团员', '居民身份证', '130425200001271027', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\"]', '家中仅有父亲一人有经济收入，母亲患有高血压，腰间盘突出，心脏病等慢性疾病，父亲也有高血压，他们需要常年吃药。有两个正在上大学的学生，有高额的生活费和学费。', '河北省邯郸市大名县王村乡店东村', '13930011814', '18000609476', '', '/uploads/synthesize/poor/廉晓慧2018510843/2021/05/14/06f317bad421c6dc3bdc3a23cbae2f176eca1d07/IMG_20210514_125325.jpg', 1620968089, 1620968089),
(60, 665, '共青团员', '居民身份证', '130426199912093920', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭成员失业\",\"家庭欠债\",\"其他\"]', '父亲患有心脏病，经常性疼痛，长期吃药，因以前常年打工伴有腰间盘突出，至今不能干活。母亲患有颈椎病，压迫神经致使两手常年麻木，不能干活。由于给父母看病，给亲戚朋友借钱，欠下债务，无偿还能力。', '河北省邯郸市涉县固新镇固新村', '15932034675', '15230011274', '', '/uploads/synthesize/poor/冯昱娟2018510821/2021/05/14/2c167f54f284f383b110bb5e1f788de0000bd861/IMG_20210514_131107.jpg', 1620969296, 1620969296),
