(70, 582, '共青团员', '居民身份证', '130281200004033120', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\"]', '母亲因身体疾病需长年服用高昂药物，父亲母亲均年迈，家庭全靠父亲打零工来勉强维持', '河北省唐山市遵化市新店子镇君子口村', '13513152055', '18332103421', '', '/uploads/synthesize/poor/袁佳怡2018510636/2021/05/14/c1c63761f280c74394b62aebb06db6c73291c0d9/Screenshot_2021-05-13-23-29-44-24.jpg', 1620972864, 1620972864),
(71, 548, '共青团员', '居民身份证', '130722200003056045', 0, 0, 0, 0, 0, 0, 1, 0, '[\"家庭遭受突发意外事件\",\"家庭成员因残疾\",\"家庭适龄就学子女较多\",\"家庭成员失业\",\"家庭欠债\"]', '父母失业，现无固定工作 ，父亲患有痛风，母亲去年做了妇科手术，不能干重活，家中还有残疾的姥爷（做了三次开颅手术，现有癫痫后遗症）需要每年支付大量医药费，还要供自己和弟弟上学，经济压力过大，', '河北省张家口市张北县宏昊小区', '13333034015', '17303215942', '', '/uploads/synthesize/poor/马佳琪2018510564/2021/05/14/7c63b41fee92c7b670e497a4992d3666972d231b/贫困申请书.docx', 1620974040, 1620974040),
(72, 539, '共青团员', '居民身份证', '130133199905192119', 0, 0, 0, 0, 0, 0, 0, 0, '[\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\"]', '妹妹在南柏舍镇中学就读，爷爷奶奶年纪大无法参加劳动', '河北省石家庄市赵县南柏舍镇北李疃村', '13180046237', '19930532304', '', '/uploads/synthesize/poor/郭紫阳2018510463/2021/05/14/5842dc4bc20591324d6855c2c3b5a411f93ab5bb/Screenshot_2021-05-14-15-10-21-749_com.miui.gallery.jpg', 1620976414, 1620976414),
(73, 559, '共青团员', '居民身份证', '131122200010301246', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"年迈而劳动能力弱情况\",\"家庭适龄就学子女较多\",\"家庭成员失业\"]', '爷爷常年吃药，爸爸失业，前段时间因高血压住院，无法工作，家里的经济来源只有母亲一个人，我和弟弟都在上大学，每年开销很大，家庭经济困难', '河北省衡水市武邑县紫塔乡张顺子村', '15076836910', '19943400741', '', '/uploads/synthesize/poor/张银月2018510566/2021/05/14/fcd87954fbead0673c421a2e848bae98ff91a300/IMG_20210514_150426.jpg', 1620976483, 1620976483),
(74, 569, '共青团员', '居民身份证', '130637200009062146', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受家庭遭受自然灾害\",\"家庭遭受突发意外事件\",\"家庭欠债\"]', '奶奶长期吃药需要人照顾，妈妈腿部不能用力没有工作，爸爸务农维持生计，我和妹妹学费昂贵开销很大，因为疫情还欠了几万块钱', '河北省保定市博野县南小王乡南杨村', '15027819318', '15076265528', '', '/uploads/synthesize/poor/姚越华2018510540/2021/05/14/49a79c53c7712bb91b7565fc16ce5b87ddff7f77/IMG20210514152703.jpg', 1620977259, 1620977259),
(75, 567, '共青团员', '居民身份证', '130625199912273715', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"其他\"]', '爷爷奶奶的相继离世，母亲又患有糖尿病，对我们这个本就不富裕的家庭来说更是雪上加霜，家庭的重担就落在了外出打工的父亲身上', '河北省保定市徐水区安肃镇沿公村', '13483270922', '18332218539', '', '/uploads/synthesize/poor/肖赛2018510444/2021/05/14/b3dc485a150ddd3054276dcde91d0add02b74a17/IMG_20210514_153740.jpg', 1620978108, 1620978108),
(76, 685, '共青团员', '居民身份证', '130982200010301448', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受突发意外事件\",\"家庭成员失业\",\"家庭欠债\"]', '其他', '河北省任丘市辛中驿镇北辛中驿村', '13315722318', '13315722318', '', '/uploads/synthesize/poor/白佳薇2018510595/2021/05/14/2e7634f9ba20ae26d4c82d725e2ae942bb69851c/F262F1B7-BBF3-4D58-BEE1-A75927DE8ECB.jpeg', 1620978186, 1620978186),
(77, 606, '共青团员', '居民身份证', '131182200008130229', 0, 0, 0, 0, 0, 0, 0, 0, '[\"家庭遭受家庭遭受自然灾害\",\"家庭遭受突发意外事件\",\"年迈而劳动能力弱情况\",\"家庭欠债\"]', '家庭遭遇自然灾害，导致家中唯一收入来源少之又少，难以维持家中的情况和我的开销；父亲母亲年迈亦不能有其他经济来源，家中唯一经济来源也因为自然灾害变得甚少；母亲患有腰间盘突出，父亲今年伤到了腿，卧病在床，更是雪上加霜', '河北省衡水市深州市唐奉乡柴屯村', '13653280635', '15297628836', '', '/uploads/synthesize/poor/张颖月2018510681/2021/05/14/80619e81cd652ba0f8859ec2710420e0e6ba2aa0/捕获.PNG', 1620980870, 1620980870);
